    bool circuitBreaker = false;

    enum FightResult {NOT_DETERMINED, BOXER_A_WON, BOXER_B_WON}
    enum FightState {NOT_STARTED, STARTED, FINISHED}

    uint8 private constant BOXER_A = 1;
    uint8 private constant BOXER_B = 2;

    uint256 poolCRT;
    uint256 totalBettors;
    mapping(address => bool) public hasBet;

    struct Fight {
        address creator;
        string fightName;
        string uriBoxerA;
        string uriBoxerB;
        uint256 totalPayoutBoxerA;
        uint256 totalPayoutBoxerB;
        uint256 totalCollected;
        FightResult result;
        FightState state;
        uint256 startsAt;
        bool exists;
    }

    // NFT issued to winner
    struct SmartAsset {
        address owner;
        uint256 fightId;
        FightResult fightResult;
        uint256 initialValue;
        uint8 accruedInterest;
    }

    // holds all NFTs issued to winners
    mapping(uint256 => SmartAsset) smartAssets;

    // holds all created fights (key: idCounter)
    mapping(uint256 => Fight) fights;
    
    // holds all apiFightId -> onChainFightId to prevent duplicate entries
    mapping(uint256 => uint256) apiFights;

    // holds all bets on a fight
    // mapping(fightId => mapping(gameResult => smartAssetId[])) fightBets;
    mapping(uint256 => mapping(FightResult => uint256[])) fightBets;

    mapping(bytes32 => uint256) fightResultRequestIds;
    
    mapping (uint256 => string) private _tokenURIs;

    address public constant CRT = 0x281027C6a46142D6FC57f12665147221CE69Af33; //CRT swap to UVT
    IERC20 crtToken;

    ////////////////////////////////////////
    //                                    //
    //           CONSTRUCTOR              //
    //                                    //      
    ////////////////////////////////////////

    constructor() ERC721("StreamFightersBet", "SFB") {
        owner = msg.sender;
        crtToken = IERC20(CRT);
    }

    ////////////////////////////////////////
    //                                    //
    //              EVENTS                //
    //                                    //      
    ////////////////////////////////////////

    event FightCreatedEvent(address creator, uint256 indexed fightId, uint256 indexed apiFightId, uint256 startAt, uint256 indexed createdOn);
    event BetPlacedEvent(address indexed bettor, uint256 indexed fightId, uint256 amount, uint256 indexed betPlacedAt);
    event SmartAssetAwardedEvent(address indexed awardee, uint256 indexed fightId, uint256 smartAssetId, uint256 awardedAt);
    event FightClosedEvent(address indexed by, uint256 indexed fightId, uint256 closedAt);
    event FightResultSetEvent(uint256 indexed fightId, FightResult result, uint256 setAt);
    event AssetLiquidatedEvent(address indexed by, uint256 indexed fightId, uint256 amount, uint256 liquidatedAt);
    event TokenURISet(uint256 tokenId, string uri);

    ////////////////////////////////////////
    //                                    //
    //              MODIFIERS             //
    //                                    //      
    ////////////////////////////////////////

    /*
    *  @notice  Restrict caller only owner
    */
    modifier onlyOwner() {
        require(msg.sender == owner, "caller is not owner");
        _;
    }

    /*
    *  @notice  Ensure fight does not previously exist
    */
    modifier isNewFight(uint256 _fightId) {
        require(!fights[_fightId].exists, "on chain fight exists");
        _;
    }

    /*
    *  @notice  Ensure api fight does not previously exist
    */
    modifier isNewAPIFight(uint256 _api_fightId) {
        require(apiFights[_api_fightId] == 0, "api fight ID exists");
        _;
    }

    /*
    *  @notice  Ensure fight exists
    */
    modifier fightExists(uint256 _fightId){
        require(fights[_fightId].exists, "on chain fight does not exist");
        _;
    }

    /*
    *  @notice  Ensure fight has not started
    */
    modifier fightNotStarted(uint256 _fightId){
        require(fights[_fightId].state == FightState.NOT_STARTED, "fight started");
        _;
    }

    /*
    *  @notice  Ensure fight has started
    */
    modifier fightStarted(uint256 _fightId){
        require(fights[_fightId].state == FightState.STARTED, "fight not started");
        _;
    }

    /*
    *  @notice  Ensure fight has ended
    */
    modifier fightFinished(uint256 _fightId){
        require(fights[_fightId].state == FightState.FINISHED, "fight not finished");
        _;
    }

    /*
    *  @notice Checks if core functionalities can be performed
    *  @dev Checks if the circuitBreaker state variable is false
    */
    modifier isCircuitBreakOff() {
        require(!circuitBreaker, "Circuit breaker is on");
        _;
    }

    /*
    *  @notice Checks if the NFT is valid
    *  @dev Validates NFT
    */
    modifier validateToken(uint256 _tokenId) {
        require(_exists(_tokenId), "Invalid token");
        _;
    }
    
    /*
    *  @notice  Ensure token belongs to the caller
    */
    modifier isTokenOwner(uint256 _tokenId) {
        require(ownerOf(_tokenId) == msg.sender , "caller is not token owner");
        _;
    }

    /*
    *  @notice  Ensures bets are allowed on the fight
    *  @dev     The totalCollected on the fight must be greater than the total payout on the Boxer the bettor wants to bet on. The incoming bet is inclusive in the calculation
    */
    modifier isBetAllowed(uint256 _fightId) {
        require(true, "Bet is not allowed");
        _;
    }
    
    modifier validateFightResult(uint8 _fightResult) {
        require(FightResult(_fightResult) == FightResult.BOXER_A_WON || FightResult(_fightResult) == FightResult.BOXER_B_WON, "Invalid fight result");
        _;
    }

    ////////////////////////////////////////
    //                                    //
    //              FUNCTIONS             //
    //                                    //      
    ////////////////////////////////////////

    /*
    *  @notice  Creates a new fight
    *  @dev     Initializes a new fight with details and metadata URIs for each boxer
    *  @param   _apiFightId The API identifier for the fight
    *  @param   fightName The name of the fight
    *  @param   _uriBoxerA Metadata URI for Boxer A
    *  @param   _uriBoxerB Metadata URI for Boxer B
    *  @param   _startAt The start time of the fight
    *  @return  The ID of the created fight
    */
    function createFight(uint256 _apiFightId, string calldata fightName, string calldata _uriBoxerA, string calldata _uriBoxerB, uint256 _startAt)
        public 
        isNewAPIFight(_apiFightId)
        onlyOwner
        returns(uint)
    {
        fightIds.increment();
        uint256 fightId = fightIds.current();
        fights[fightId] = Fight(msg.sender, fightName, _uriBoxerA, _uriBoxerB, 0, 0, 0, FightResult.NOT_DETERMINED, FightState.NOT_STARTED, _startAt, true); 
        apiFights[_apiFightId] = fightId;
        uint256 createdOnDay = block.timestamp - (block.timestamp % 86400);
        emit FightCreatedEvent(msg.sender, fightId, _apiFightId, _startAt, createdOnDay);

        return fightId;
    }

    /*
    *  @notice  New bet creation and mint NFT (for CRT Token bets)
    *  @dev     Places a bet using CRT Tokens and mints an NFT to the bettor
    *  @param   _fightId The ID of the fight on which the bet is placed
    *  @param   _resultBetOn The expected result of the fight (Boxer A or B)
    *  @param   amountBet The amount of bet in CRT tokens
    *  @return  The ID of the minted NFT token
    */
    function placeBetCRT(uint256 _fightId, uint8 _resultBetOn, uint256 amountBet)
        public 
        isCircuitBreakOff
        fightExists(_fightId) 
        fightNotStarted(_fightId) 
        isBetAllowed(_fightId)
        validateFightResult(_resultBetOn)
        nonReentrant
        returns(uint256)
    {
        require(amountBet != 0, "Invalid amount bet");
        require(fights[_fightId].startsAt < block.timestamp, "Time is up");

        address bettor = msg.sender;

        if (!hasBet[msg.sender]) {
            hasBet[msg.sender] = true;
            totalBettors++;
        }

        FightResult fightResultBetOn = FightResult(_resultBetOn);
        
        //update Boxer's total payout
        if (fightResultBetOn == FightResult.BOXER_A_WON) {
            fights[_fightId].totalPayoutBoxerA = fights[_fightId].totalPayoutBoxerA + amountBet;
        } else if(fightResultBetOn == FightResult.BOXER_B_WON) {
            fights[_fightId].totalPayoutBoxerB = fights[_fightId].totalPayoutBoxerB + amountBet;
        }

        //increase totalCollected on the fight
        fights[_fightId].totalCollected = fights[_fightId].totalCollected + amountBet;
        poolCRT += amountBet;

        require(crtToken.transferFrom(msg.sender, address(this), amountBet), "Transfer CRT failed");
        uint256 smartAssetId = awardSmartAsset(bettor, amountBet, _fightId, fightResultBetOn);
        
        //Save bettor's bet
        fightBets[_fightId][fightResultBetOn].push(smartAssetId);
        
        emit BetPlacedEvent(bettor, _fightId, amountBet, block.timestamp);

        return smartAssetId;
    }

    
    /*
    *  @notice  Awards a new Smart Asset (NFT) to the bettor.
    *  @dev     Increments the token ID counter and mints a new NFT with a URI based on the chosen fighter.
    *  @param   bettor The address of the individual placing the bet.
    *  @param   betAmount The amount bet by the individual.
    *  @param   _fightId The ID of the fight on which the bet is placed.
    *  @param   _fightResultBetOn The outcome the bet is placed on (e.g., Boxer A won, Boxer B won).
    *  @return  Returns the ID of the newly minted NFT.
    */
    function awardSmartAsset(address bettor, uint256 betAmount, uint256 _fightId, FightResult _fightResultBetOn) 
        internal returns (uint256) 
    {
        tokenIds.increment();

        uint256 smartAssetId = tokenIds.current();


        // Decide which URI to use based on the fighter chosen for the bet
        string memory boxerUri;
        if (_fightResultBetOn == FightResult.BOXER_A_WON) {
            boxerUri = fights[_fightId].uriBoxerA;
        } else if (_fightResultBetOn == FightResult.BOXER_B_WON) {
            boxerUri = fights[_fightId].uriBoxerB;
        }

        _mint(bettor, smartAssetId);
        _setTokenURI(smartAssetId, boxerUri);
        
        smartAssets[smartAssetId] = SmartAsset(msg.sender, _fightId, _fightResultBetOn, betAmount, 0);

        emit SmartAssetAwardedEvent(bettor, _fightId, smartAssetId, block.timestamp);

        return smartAssetId;
    }
    
    /*
    *  @notice  Changes the fight state to started
    *  @dev     Marks a fight as started; can only be done by the contract owner
    *  @param   _fightId The ID of the fight to start
    */
    function startFight(uint256 _fightId) 
        public
        onlyOwner
        fightExists(_fightId) 
        fightNotStarted(_fightId)
    {
        fights[_fightId].state = FightState.STARTED;
    }


    /*
    *  @notice  Closes the fight and sets the result
    *  @dev     Marks a fight as finished and sets the winning boxer. Invalidates losing bets.
    *  @param   _fightId The ID of the fight to close
    *  @param   _fightResult The result of the fight (winning boxer)
    *  @return  success The status of the operation (true/false)
    */
    function closeFight(uint256 _fightId, uint8 _fightResult)
        public 
        onlyOwner
        fightExists(_fightId) 
        fightStarted(_fightId)
        validateFightResult(_fightResult)
        nonReentrant
    {
        fights[_fightId].state = FightState.FINISHED;
        
        FightResult fightResult = FightResult(_fightResult);
        setFightResult(_fightId, fightResult);
        
        if (fightResult == FightResult.BOXER_A_WON) {
            invalidateAssets(fightBets[_fightId][FightResult.BOXER_B_WON]);
        } else if (fightResult == FightResult.BOXER_B_WON) {
            invalidateAssets(fightBets[_fightId][FightResult.BOXER_A_WON]);
        } else {
            invalidateAssets(fightBets[_fightId][FightResult.BOXER_A_WON]);
            invalidateAssets(fightBets[_fightId][FightResult.BOXER_B_WON]);
        }
        
        
        emit FightClosedEvent(msg.sender, _fightId, block.timestamp);
    }
    
    /*
    *  @notice  Sets the result of a fight
    *  @dev     Updates the fight with the final result (Boxer A won, Boxer B won)
    *  @param   _fightId The ID of the fight
    *  @param   _fightResult The final result of the fight
    */
    function setFightResult(uint256 _fightId, FightResult _fightResult) internal {
        fights[_fightId].result = _fightResult;
        emit FightResultSetEvent(_fightId, fights[_fightId].result, block.timestamp);
    }
    
    /*
    *  @notice  Invalidates a list of smart assets (NFTs)
    *  @dev     Burns the NFT tokens in the provided list
    *  @param   assets An array containing the IDs of the NFT tokens to invalidate
    */
    function invalidateAssets(uint256[] memory assets) internal {
        for (uint i = 0; i < assets.length; i++) {
            invalidateAsset(assets[i]);
        }
    }

    /*
    *  @notice  Invalidates a single smart asset (NFT)
    *  @dev     Burns the NFT token with the given ID
    *  @param   _smartAssetId The ID of the NFT to invalidate
    */
    function invalidateAsset(uint256 _smartAssetId) internal {
        _burn(_smartAssetId);
    }

    /*
    *  @notice  Calculates the payout for a bet
    *  @dev     Calculates the amount to be paid out to the bettor based on the parimutuel betting system
    *  @param   _fightId The ID of the fight
    *  @param   initialValue The initial bet amount
    *  @param   fightResult The result of the fight
    *  @return  The amount to be paid out to the bettor
    */
    function calculatePayout(uint256 _fightId, uint256 initialValue, FightResult fightResult) internal view returns (uint256) {
        uint256 winningTotal;
        if (fightResult == FightResult.BOXER_A_WON) {
            winningTotal = fights[_fightId].totalPayoutBoxerA;
        } else if (fightResult == FightResult.BOXER_B_WON) {
            winningTotal = fights[_fightId].totalPayoutBoxerB;
        }

        // Calculating payout based on the parimutuel betting system
        uint256 payout = (initialValue * fights[_fightId].totalCollected) / winningTotal;
        return payout;
    }

    /*
    *  @notice  Liquidate smart asset's value
    *  @dev     validated   NFT is burned and caller gets value funds in account
    *  @param   _smartAssetId smart asset id
    *  @return  success status
    */
    function liquidateAssetCRT(uint256 _smartAssetId)
        public 
        isCircuitBreakOff
        validateToken(_smartAssetId)
        isTokenOwner(_smartAssetId)
        nonReentrant 
        returns(bool)
    {
        SmartAsset memory smartAsset = smartAssets[_smartAssetId];
        
        require(fights[smartAsset.fightId].state == FightState.FINISHED, "Cannot liquidate asset until fight is finished");
        
        uint256 payoutAmount = calculatePayout(smartAsset.fightId, smartAsset.initialValue, smartAsset.fightResult);
        require (crtToken.balanceOf(address(this)) >= payoutAmount, "Contract has insufficient CRT funds");
        
        invalidateAsset(_smartAssetId);
        crtToken.transfer(msg.sender, payoutAmount);

        emit AssetLiquidatedEvent(msg.sender, smartAsset.fightId, payoutAmount, block.timestamp);
        return true;
    }

    /*
    *  @notice  Sets the URI for a token
    *  @dev     Sets the metadata URI for a given NFT token
    *  @param   tokenId The ID of the token
    *  @param   _tokenURI The URI to set for the token
    */
    function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal virtual {
        require(_exists(tokenId), "ERC721Metadata: URI set of nonexistent token");
        _tokenURIs[tokenId] = _tokenURI;
        emit TokenURISet(tokenId, _tokenURI);
    }

    /*
    *  @notice  Fetches the URI for a token
    *  @dev     Retrieves the metadata URI of a given NFT token
    *  @param   tokenId The ID of the token
    *  @return  The metadata URI of the token
    */
    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return _tokenURIs[tokenId];
    }

    /*
    *  @notice  Contract Circuit Breaker
    *  @dev     Admin can [de]activate core functons in contract
    *  @param   
    *  @return  success success status
    */
    function toggleCircuitBreaker()
        public 
        onlyOwner
    {
        circuitBreaker = !circuitBreaker;
    }

    /*
    *  @notice  Fetch fight details
    *  @dev         
    *  @oaram   _fightId
    *  @return fight fight details
    */
    function getFight(uint256 _fightId)
        public 
        view
        fightExists(_fightId)
        returns(Fight memory fight_)
    {
        return fights[_fightId];
    }

    /*
    *  @notice  Fetch single SmartAsset
    *  @dev          
    *  @param   _smartAssetId
    *  @return  asset details
    */
    function getSmartAsset(uint256 _smartAssetId)
        public 
        view
        validateToken(_smartAssetId)
        returns(SmartAsset memory asset)
    {
        return smartAssets[_smartAssetId];
    }

    function getTotalBettors() public view returns (uint256) {
        return totalBettors;
    }

    function getPoolCRT() public view returns (uint256) {
        return poolCRT;
    }

    /*
    *  @notice  Tells of the msg.sender is the admin
    *  @dev
    *  @return  true if msg.sender is admin else false
    */
    function isAdmin() public view returns(bool) {
        return msg.sender == owner;
    }

    /*
    *  @notice  Allows the current owner pass ownership to another address
    *  @dev
    */
    function changeOwner(address newOwner) 
    external 
    onlyOwner {
        owner = newOwner;
    }

    receive() external payable {}
}

